### Issue description
It looks like shape inference doesn't make use of initializer shapes, so even super simple graphs can fail to gain any useful info from shape inference.

I suppose one caveat should be that shape inference shouldn't rely on initializers which are also inputs, since their shape could definitely change at runtime.

### MRE
Run shape inference with the exact same model, but with and without adding explicit value info for the initializer.

<details>

```python
model = onnx.helper.make_model(onnx.helper.make_graph(
    nodes=[
        onnx.helper.make_node("Gemm", ["x", "m"], ["y"]),
        onnx.helper.make_node("Identity", ["y"], ["z"]),
    ],
    name="graph1",
    inputs=[
        onnx.helper.make_tensor_value_info("x", onnx.TensorProto.FLOAT, ["dim1",7]),
    ],
    outputs=[
        onnx.helper.make_tensor_value_info("z", onnx.TensorProto.FLOAT, ["dim2",13]),
    ],
    initializer=[
        onnx.numpy_helper.from_array(np.zeros((7,13), dtype=np.float32), name="m"),
    ],
    value_info=[
    ],
))
```
